import React from "react";
import Data from "../example_data.json";

import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Typography from "@mui/material/Typography";
import Avatar from "@mui/material/Avatar";
import FiberManualRecordIcon from "@mui/icons-material/FiberManualRecord";

import ImageList from "@mui/material/ImageList";
import ImageListItem from "@mui/material/ImageListItem";
import {CardActionArea} from "@mui/material";
import {borderColor, flexbox} from "@mui/system";
import {Box} from "@mui/material";

export const PlaceList = () => {
  const Date = (value) => {
    return value
      .filter((item) => item.day === "Monday")
      .map((item) => `${item.time_open} AM - ${item.time_close} PM`);
  };

  const info = Data.map((item) => (
    <Card
      key={item.id}
      sx={{
        bgcolor: "background.paper",
        m: 1,
        border: 1,
        borderColor: "primary.main",
        width: "10",
        maxWidth: 200,
      }}>
      <CardHeader
        avatar={
          <Avatar src={item.profile_image_url} variant="rounded">
            {" "}
            {item.id}
          </Avatar>
        }
        action={<FiberManualRecordIcon />}
        title={item.name}
        subheader={Date(item.operation_time)}
      />
      {/* <div
        style={{
          display: "flex",
          alignItem: "center",
          justifyContent: "center",
          border: 1,
          borderColor: "primary.main",
          borderRadius: "25px",
        }}> */}
      <Box
        sx={{
          display: "flex",
          border: 1,
          borderColor: "primary.main",
          borderRadius: "25px",
        }}>
        {item.images.map((imgs, index) => (
          <CardMedia
            key={index}
            sx={{
              width: "auto",
              height: "200px",
              objectFit: "contain",
            }}
            component="img"
            image={imgs}
            title="Contemplative Reptile"
          />
        ))}
      </Box>
      {/* </div> */}
      <CardContent sx={{borderColor: "primary.main"}}></CardContent>
    </Card>
  ));

  return <>{info}</>;
};
